        <div className="row">
          <button
            type="button"
            className="btn btn-primary btn-lg"
            data-toggle="modal"
            data-target="#modelDevice"
          ></button>
        </div>
        {/* device list */}

        <div className="row">
          <div className="col-6">
            <Device />
          </div>
          <div className="col-6">
            <Device />
          </div>
        </div>
      </div>
    );
  }
}
